import { Flex, Container, Box, Stack, Typography, Card, Divider, CardMedia, Grid } from "@mui/material";
import image from './images/image5.png';

const MazeGameCard = (
  <Card sx={{ bgcolor: "cyan" }}>
    <Typography sx={{ fontSize: 20 }} color="text.primary" gutterBottom>
      Maze Game
    </Typography>
    <Divider />
    <CardMedia
      component="img"
      alt="Project Image"
      height="200"
      src={image}
      style={{
        objectFit: "cover",
        width: "100%",
        height: "100%",
      }}
    />
  </Card>
);

const DevOpsCard = (
  <Card sx={{ bgcolor: "cyan" }}>
    <Typography sx={{ fontSize: 20 }} color="text.primary" gutterBottom>
      Dev Ops
    </Typography>
    <Divider />
    <CardMedia
      component="img"
      alt="Project Image"
      height="200"
      src={image}
      style={{
        objectFit: "cover",
        width: "100%",
        height: "100%",
      }}
    />
  </Card>
);

function Projects() {
  return (
    <Container
      fixed
      sx={{
        bgcolor: "transparent",
        marginTop: '10vh',
        marginBottom: '10vh',
      }}
    >
      <Grid item xs={2} sm={2} md={s} lg={2}>
        <h1>Projects</h1>
          <Box sx={{ flex: 1, textAlign: 'center' }}>
            <a href="/MazeGame" style={{ textDecoration: "none" }}>
              {MazeGameCard}
            </a>
          </Box>
          <Box sx={{ flex: 1, textAlign: 'center' }}>
            {DevOpsCard}
          </Box>
      </Grid>
    </Container>
  );
}

export default Projects;
